INSERT INTO `article` (`id_Article`, `titre_Article`, `texte_Article`, `urlImage_Article`, `pseudo_Profil`, `Categorie_id_Categorie`, `date_Article`, `sup_Video`) VALUES
(1, '[CURSEURISATOR] Placez vos curseurs de faction sur vos photos !', 'Mais qu''est-ce donc, me demanderez-vous ? Eh bien il s''agit d''un espace sur lequel vous pouvez placer (tres facilement) des curseurs NOOB sur la tete de n''importe qui, figurant sur une photo. En cette periode de rivalite exacerbee entre les factions, envahissez les reseaux sociaux avec des curseurs aux couleurs de l''EMPIRE, de l''ORDRE ou de la COALITION (il y a meme les curseurs des Maitres du jeu) ! Faites trembler vos adversaires en vue de la sortie de la saison 6 de NOOB et du GRAND REX ! Qu''une vague jaune, verte ou rouge envahisse la toile et prenne le pouvoir ! Montrez quelle faction est la meilleure !\r\n', NULL, 'Noob', 1, '2015-01-03', 0),
(2, '[BONUS] Les vidéos bonus parodiques diffusées lors du show au Grand Rex', 'A l''occasion du Show NOOB au Grand Rex et de l''impitoyable affrontement entre l''Empire, l''Ordre et la Coalition, nous avons propose quelques jeux bonus, dont ce "Noob dance" dejante. Voici les versions EMPIRE, COALITION et ORDRE. En dessous, vous aurez ensuite les parodies de publicite que nous avons dissimule parmi les bandes annonces de web-series diffusees avant le film NOOB saison 6 !\r\n\r\nPS : A noter que toutes ces videos sortent du cerveau de Gaea, qui devient de plus en plus creative ^^', NULL, 'Noob', 2, '2015-01-15', 0),
(3, '[ENCYCLOPEDIE] La carte d''Olydri', 'Bonjour a toutes et a tous ! \r\n\r\nAujourd''hui, nous sommes content de vous presenter une nouvelle carte du monde d''Olydri. Elle a ete dessinee par Phanat Pak (Ash le farmer chinois) et permet de decouvrir les villes et la topographie du monde d''Olydri a l''epoque d''Horizon 3.0 (donc le 3eme cycle). Si vous zoomez, vous pouvez voir cinq couleurs differentes. En voici la legende :\r\n\r\n- En jaune, ce sont les villes de l''Empire\r\n- En rouge, ce sont les villes de la Coalition\r\n- En vert, ce sont les villes de l''Ordre\r\n- En violet, ce sont les villes du Chaos (sansames sous les ordres de Saralzar)\r\n- En bleu, ce sont les villes Gagnetorith (confederation marchande)\r\n- En blanc, les lieux hors du temps et de la geopolitique\r\n\r\nUne version avec les regions, les noms des lacs, rivieres, mers, oceans, plaines, forets, etc... sortira apres la sortie du film 1.', NULL, 'Noob', 3, '2014-12-13', 0);

