INSERT INTO `bete` (`id_Bete`, `nom_Bete`, `urlImage_Bete`, `description_Bete`, `environnement_Bete`, `difficulte_Bete`, `statut_Bete`, `Recompense_id_Recompense`, `TypeBete_id_TypeBete`) VALUES
(5, 'Korrigan des rivages', NULL, 'Creatures humanoides hautes d''une soixantaine de centimetres a la peau blanchatre, aux jambes courtes et musclees, dont les pieds possedent quatre orteils. Leurs bras osseux sont termines par de grosses mains aux longs doigts. Ils sont vetus d''algues et de coquillages et ils ont des crocs et deux rangees de petites dents acerees. ', 'Les grottes de Piratas', 'Non renseigné', 0, 1, 1),
(6, 'Burblobe', NULL, 'Le burblobe est une sorte de gros poisson de couleur rouge qui possede une nageoire dorsale, deux cornes sur la tete et une autre corne en bas du dos. Il se deplace hors de l''eau en rebondissant sur une sorte de poche transparente (semblable a une grosse bulle). Pour tuer le burblobe, il suffirait de detruire cette poche.', 'Les rivages du continent de Keos', 'Niveau 34', 0, 2, 2),
(7, 'Smourbiff', NULL, 'Le smourbiff est une creature d''environ 30 cm de haut, sa tete est souvent surplombee d''une petite corne. Le smourbiff n''a pas de pattes anterieures et doit se dandiner sur ses pattes arrieres pour garder l''equilibre ou bien se deplacer par bonds. Il communique par des petits cris ''BI'', ''BIF''. Le smourbiff est un familier parfaitement inoffensif et tres facile a apprivoiser. Des joueurs comme Sparadrap les collectionne. Il est egalement chasse pour sa fourrure qui permet de creer des vetements tres chauds pour les equipements anti-froid notamment.', 'Olydri', 'Aucune', 0, 3, 3),
(8, 'Pikouaï', NULL, 'Le Pikouai est une petite creature bipede a la fourrure grise et aux yeux rouges, qui se protege de ses ennemis grace a sa longue queue bicephale et pointue. Il en existe des sauvages, au comportement agressif, et d''autres bien plus dociles, voues a devenir des familiers. Pourtant difficile a apprivoiser, il devient neanmoins tres loyal une fois qu''il a choisi et reconnu son maitre. Le pikouai evolue notamment sur les terres de l''Ordre, dans un milieu chaud et humide. \r\n', 'Continent de Syrial, habitat tropical\r\n', 'Aucune', 0, 4, 1),
(9, 'Dragon noir de Fosphorgos', NULL, 'Creature volante et predateur presque legendaire, le Dragon noir de Fosphorgos est l''un des plus plus puissants ennemis a affronter dans l''univers d''Olydri. D''ailleurs, la race etant presque eteinte, il n''en reste plus qu''un seul vivant a l''heure actuelle dans ce monde, et le vaincre permet de debloquer un important Haut-Fait. Le Dragon noir de Fosphorgos est une creature colossale, mesurant pres de 12 metres de hauteur pour 30 de long. Recouvert d''ecailles noires et argentees sur presque l''integralite de son corps et de griffes aussi mortelles que ses crocs imposant, sa seule faiblesse connue se situe au niveau de son ventre.\r\n', 'Montagnes de Vulca', 'Niveau 90 à 100', 0, 5, 1),
(10, 'Gouinfrosaurus\r\n', NULL, 'Le Gouinfrosaurus est un parent bien en chair du Tyrannosaure. Il mesure entre 5 et 10 metres de haut, son corps est parcouru d''ecailles de couleur rouge zebree de vert et de jaune dans le dos. Il est muni de trois cornes noires sur son crane, la centrale etant plus proeminente que les deux autres. Il a un ventre adipeux  et il a une demarche dandinante a cause de ses pattes trop courtes. Il est egalement pourvu de deux pattes superieures minuscules. Sa tete est enorme, et sa machoire impressionnante, tres proche de celle du Tyrannosaure. Il est pourvu d''une machoire gigantesque et de rangees de dents acerees ainsi que d''un goitre semblable a celui d''un albatros.\r\n\r\nLes dents de Gouinfrosaurus sont des objets de quete.', 'Les montagnes de Rochebrume', 'Non renseigné', 0, 6, 1),
(11, 'Cochoboule', NULL, 'Generalement decrit comme une grosse boule rose et molle avec de longues oreilles et des pattes courtes. Les males portent des cornes qui constituent des objets de quetes. Si le cochoboule peut se montrer  agressif, notamment les femelles lorsqu''il s''agit de proteger leurs petits, il peut toutefois etre apprivoise pour devenir un familier ou une invocation. On raconte que les vieux males vivent leur vie seuls et possedent les cornes les plus solides de l''univers d''Olydri.\r\n', 'Plaine de Centralis et région de Fermepaille', 'Non renseigné', 0, 7, 1),
(12, 'Leviathan', NULL, 'Gigantesque serpent de mer recouvert d''ecailles acerees et d''une queue a la puissance devastatrice capable de faire sombrer un navire d''un seul coup.\r\nD''un temperament tres agressif, il attaque a vue toute embarcation a portee.', 'zone maritime entre Forpitas et l''île de Piratas', 'Niveau 83', 0, 8, 2);

