INSERT INTO `lieu` (`id_Lieu`, `nom_Lieu`, `urlImage_Lieu`, `description_Lieu`, `statut_Lieu`, `Recompense_id_Recompense`, `TypeLieu_id_TypeLieu`) VALUES
(1, 'Foret de Bruissebois', NULL, 'Située au nord-ouest du continent de Keos, cette zone boisée n’est pas particulièrement dangereuse, sauf quand les player-killer la parcourent. Plusieurs quêtes y sont proposées par un mage noir.\r\n', 0, 0, 3),
(2, 'Citadelle du Néant', NULL, 'La citadelle du Néant se trouve au centre du Cratère du Cataclysme, à la frontière entre les montagnes de Lassierra et la région de Vulca.\r\nSon apparition coïncide avec la tentative de reconquête du monde par Dörtos, la multiplication des sansâmes et la diffusion du Mal Sombre.\r\n Elle apparaît avec la mise à jour Horizon 1.1.\r\n', 0, 0, 5),
(3, 'Menelys\r\n', NULL, 'Le village de Menelys est considéré comme une zone neutre au sein de laquelle les joueurs des différentes factions peuvent interagir en tout tranquilité...du moins, en théorie. C’est également un endroit réputé pour farmer des crédits. \r\n', 0, 0, 2),
(4, 'Chateau de Bardenord', NULL, 'Ce lieu est en fait une zone PvP régulièrement envahie par les joueurs de la Coalition, ce qui entraîne pour l’Ordre une quête consistant à la reconquérir. Il abrite également le Comte Melcoün. ', 0, 0, 4),
(5, 'Continent de Syrial', NULL, 'Le continent de Syrial est situé au Nord-Ouest de Keos, et bénéficie d’un climat tropiacl, à la fois chaud et humide. C’est la zone qui abrite le siège de l’Ordre, sa capitale, Galaé, ainsi que la ville de départ des joueurs de l’Ordre, Ysëën. \r\n', 0, 0, 6),
(6, 'Aqualis', NULL, 'Ville sous-marine et secrète, la cité d’Aqualis est accessible uniquement via un réseau de galeries sous-marines qui relient Keos et Piratas. La cité se situe sous une gigantesque bulle d’air cachée sous l’océan, et ses bâtiments son colossaux et luminescents.\r\n', 0, 0, 1),
(7, 'Tour Galamadriyabuyak', NULL, 'La Tour Galamadriabuyak est l''un des lieux les plus emblématiques de Horizon. Il permet aux joueurs de débloquer la dizaine de niveaux supérieurs grâce à son système de paliers. Elle possède 10 étages et le dernier donne accès aux très convoitées classes légendaires du crépuscule, de l''aurore ou de l''infini.\r\nLa tour se situe sur le continent de Keos. Elle a été créée par la Source de la Vie et la Source de la Mort.\r\n', 0, 0, 7),
(8, 'Centralis', NULL, 'Centralis est la capitale de l''Empire.\r\n\r\nÀ la suite du crash d''un vaisseau spatial sur les terres de la famille Lucans, ceux-ci découvrent les secrets de la technologie et c''est autour de ce vaisseau nimbé de mystère que s''est érigée la tentaculaire cité, berceau des neogiciens.\r\nLe secret de la technologie est farouchement gardé par ses habitants.\r\nLa ville est protégée contre les attaques par un bouclier de protection gigantesque, mis à mal pendant l’attaque de la Coalition, mais réactivé de justesse par la Guilde Noob.\r\n', 0, 0, 1);

