INSERT INTO `personnage` (`id_Personnage`, `nom_Personnage`, `urlImage_Personnage`, `description_Personnage`, `replique_Personnage`, `faction_Personnage`, `signe_Personnage`, `statut_Personnage`, `Recompense_id_Recompense`, `ClassePersonnage_id_ClassePersonnage`) VALUES
(3, 'Gaea', NULL, 'Gaea est une étudiante qui a intégré la guilde Noob très peu de temps après son arrivée sur Horizon 1.0. Grâce à sa ruse et à son sens inné de la manipulation, elle parvient à gagner de l’expérience très rapidement tout en évitant habilement de payer ses cotisations.  Ses méthodes quelque peu douteuses lui ont déjà valu un bannissement d’Horizon 1.0, celui-ci ayant été ensuite annulé avec l’aide de Tenshirock. Son caractère bien trempé, et même parfois odieux entraîne souvent des disputes assez épiques avec Omega Zell. \r\n', NULL, 'Empire', 'Une avarice sans limite et une capacité étonnante à attendrir son entourage pour obtenir ce qu’elle veut', 0, 0, 1),
(4, 'Sparadrap', NULL, 'Sparadrap est un véritable noob qui ne comprend pas grand chose au jeu. C''est suite à une pénurie de prêtres dans Horizon 1.0 qu''il intègre la guilde Noob. Ses gaffes sont légendaires mais il arrive parfois que, par pure chance, celles-ci servent la cause de la guilde. Sa plus grande passion est la chasse aux familiers et notamment des smourbiffs qu''il collectionne avec amour. IRL, Kévin vit avec sa grand-mère Odette et son frère Thomas (Ystos).', NULL, 'Empire', 'D''un naturel joyeux et avenant, son inexpérience n''a d''égale que sa naïveté légendaire. Il aime le flan et la chasse aux smourbiffs.\r\n', 0, 0, 2),
(5, 'Golgotha', NULL, 'Golgotha est une guerrière qui ne craint rien ni personne. En tant que mercenaire, elle se bat aux côtés des groupes qui paient ses services et n’est affiliée à aucune guilde. Cependant, pour l''amour des combats, il arrive qu''elle coopère avec la guilde Noob. Dans la vraie vie, Golgotha est la meilleure amie et la colocataire de Gaea, qu''elle surnomme affectueusement "Gaga". D''ailleurs, chaque personnage qu''elle rencontre a droit à une nouvelle version de son pseudo, ainsi Sparadrap devient "Sparamoule", Omega Zell devient "l''homme-gazelle", etc.', NULL, 'Empire', 'Elle aime se battre et donner des surnoms aux autres joueurs.', 0, 0, 3),
(6, 'Omega Zell', NULL, 'Arrogant, narcissique et macho, Omega Zell est un assassin qui se voit très bien devenir un jour le nouveau numéro 1 du jeu Horizon, et surpasser ainsi Fantöm, son idole ultime. Il se montre d’ailleurs très persévérant dans ce but, malgré de sévère lacunes et une guilde difficile, qui freine d’après lui considérablement sa progression. Car bien sûr, Omega Zell est l’un des membres phares de la guilde Noob, et vit assez mal sa collaboration avec les “boulets” comme Sparadraps et les “perfidies” répétées de Gaea, cette “fichue fille”... Il essaie malgré tout de surmonter ces épreuves pour rejoindre la Guilde Justice, mais a déjà été refusé par Saphir parce qu’il n’avait pas le niveau, ni la personnalité requise.\r\nIRL Morgan Lavande est reporter pour Féminine TV, ce qui explique beaucoup de choses.\r\n', NULL, 'Empire', 'Est incapable de parler correctement, voire de parler tout court devant Fantöm, il est aussi l’un des élus préférés de Tenshirock le Hackeur… ', 0, 0, 4),
(9, 'Arthéon', NULL, 'Arthéon est le chef de la guilde de Noob et son pilier centra, car il a beaucoup d''expérience dans les jeux de rôle. Il était autrefois un membre important de la prestigieuse guilde de Justice, avant de céder à la tentation d''acheter des crédits pirates auprès de Ash le farmer chinois. Cette incartade au règlement lui a valu la suppression de son avatar niveau 100 par le terrible Judge Dead, maître du jeu de Horizon.\r\nCette expérience traumatisante le hante toujours et il est encore aujourd''hui terrifié à la simple évocation du terme « MJ ».\r\nIRL, il a été contraint par sa mère de s''exiler dans un internat en Moselle pour lutter contre son addiction au jeu vidéo mais il a fini par fuguer pour continuer à jouer.\r\n', NULL, 'Empire', 'Arthéon est un grand fan de « background » et il met un point d''honneur à respecter le role play quand il joue. Il est également complètement phobique des maîtres du jeu.\r\n', 0, 0, 3),
(10, 'Tenshirock', NULL, 'Hacker de haut vol et ancien joueur d’Horizon 2.0, Tenshirock se considère comme chargé d’une mission : libérer les pauvres joueurs de MMO de leur addiction aux mondes virtuels. Et pour ça il est prêt à tout et conçoit des plans plus décalés les uns que les autres pour les forcer à abandonner le jeu : essayer de convaincre Fantöm de quitter Horizon, en espérant que des milliers de joueurs suivront son exemple, supprimer des items essentiels ou….laisser la guilde Noob en activité (qui occasionne des dégâts collatéraux visiblement redoutables). Il s’entend bien avec Ash le farmer chinois malgré leurs objectifs diamétralement opposés, mais est détesté par Omega Zell qu’il a déjà fait danser en public pendant des heures. \r\n', NULL, 'Aucune', 'Une créativité surprenante lorsqu’il s’agit d’échafauder des plans pour dégoûter les joueurs d’Horizon 2.0 de leur MMO préféré. \r\n', 0, 0, 6),
(11, 'Fantöm', NULL, 'Champion de l’Empire, emblème de la Guilde Justice et numéro 1 au classement dans tout Horizon, Fantöm est un joueur hors pair qui a créé successivement deux avatars, avec lesquels il a débloqué la classe légendaire de Guerrie du Crépuscule. Avant sa chute, Fantöm apparait comme un joueur blasé qui s’ouvre peu aux autres… la fin de son règne au classement après qu’il soit révélé au grand jour comme un joueur cheaté l’amène rapidement à changer ça, puisqu’il est contraint de repartir de zéro avec un nouvel avatar et d’intégrer de ce fait la guilde Noob. Victime du complot des développeurs d’Horizon, Fantöm ne se laisse pourtant pas abattre, et il gravit de nouveaux les échelons, à la loyale, et finit par réussir à réintégrer la Guilde Justice, où il se prépare actuellement à son futur combat au somment contre Spectre et Amaras.\r\n', NULL, 'Empire', 'Numéro 1 au classement avec son avatar de Guerrier du Crépuscule. Némésis d’Amaras.', 0, 0, 8),
(12, 'Ivy', NULL, 'Ivy a rejoint la guilde de Noob en dernier. Elle est d''un naturel calme et détachée mais représente un soutien précieux pour l''équipe  grâce à une très bonne maîtrise de ses compétences de Neogicienne. Elle détonne un peu des autres personnages par l''utilisation de la technologie au lieu de la magie, mais aussi par son attitude désinvolte.\r\nIRL elle habite un petit village perdu dans les Landes et elle pratique le surf avec talent.\r\n', NULL, 'Empire', 'Ivy est narcoleptique et quand elle ne prend pas son traitement, elle est susceptible de s''endormir n''importe quand. Phrase fétiche: "Ouais ouais...."\r\n', 0, 0, 7);

