(1, 'Parchemins enchantes', NULL, 'Ces parchemins contenant une incantation magique peuvent modifier temporairement les statistiques et aptitudes du joueur, agir sur son armure ou ses armes et sont egalement utilises pour lancer des sortileges. Leur puissance depend principalement de leur niveau et de leurs attributs.\r\n\r\nGeneralement, ils peuvent etre achetes (pour un prix relativement eleve) ou confectionnes par des joueurs dotes de la competence calligraphie, mais il est possible d’en obtenir en guise de recompense de quete. \r\n', 0, 0, 3),
(2, 'Sourcelame', NULL, 'Sourcelame est une epee legendaire forgee dans un metal le plus pur, charge d''un flux magique rempli d''espoir. Cette epee aurait meme sa propre conscience. Dissimulee dans une zone d''Olydri, elle est la recompense pour la quete de Sourcelame. Cette quete est particulierement difficile car pour retrouver l''epee, il est necessaire de se plonger dans de vieux manuscrits et livres, et de faire preuve de discernement pour demeler les rumeurs des indices. Longtemps considere comme une blague des developpeurs, cet item unique a ete decouvert par Artheon, après qu''il a quitte la guilde Noob.\r\n', 0, 0, 1),
(3, 'Baton cheate', NULL, 'Le baton cheate est une arme pour pretre surpuissante. Il a ete cree par Tenshirock le Hackeur dans le but de mener a bien un plan machiavelique: "l''operation Noob Power".\r\nCe plan vise a equiper les debutants avec des objets aux statistiques bien trop elevees pour degouter les autres joueurs.\r\n\r\nTenshirock a choisi de placer le baton dans l''inventaire de Sparadrap, ce qui a cause beaucoup de tumulte au sein de la guilde de Noob. Cet objet contraire au reglement du jeu exposait la guilde a la colere de Judge Dead le MJ. Apres bien des peripeties , Judge Dead finit par supprimer l''objet...qui finit par réapparaître dans l''inventaire de Sparadrap...\r\n', 0, 0, 1);

