(1, 'Gaea Invocatrice', 1, 1, 3, 'https://www.youtube.com/embed/Tv9H1vv-Qrs', , 'Apres s''etre procure Horizon 1.0, le dernier jeu a la mode, Gabrielle Jolivet se lance dans la creation de son avatar...', 0);
INSERT INTO `video` (`id_Video`, `nom_Video`, `saison_Video`, `episode_Video`, `duree_Video`, `url_Video`, `image_Video`, `synopsis_Video`, `sup_Video`) VALUES
(2, 'La guilde noob', 1, 2, 4, 'http://www.youtube.com/embed/5dKTIWwi5y4', , 'Gaea l''invocatrice, l''avatar cree par Gabrielle, fait ses premiers pas dans Horizon. Tres vite, elle rencontre Sparadrap, le pretre simplet de la guilde Noob...', 0);
INSERT INTO `video` (`id_Video`, `nom_Video`, `saison_Video`, `episode_Video`, `duree_Video`, `url_Video`, `image_Video`, `synopsis_Video`, `sup_Video`) VALUES
(3, 'Fausse route', 1, 3, 4, 'http://www.youtube.com/embed/xQMPN-fxitU', , 'Ayant accepte de rejoindre la guilde Noob, Gaea, accompagnee de Sparadrap, se rend a la chambre des guildes. En chemin, elle fait la connaissance d''Omega Zell, un assassin misogyne avec qui la collaboration s''annonce difficile...', 0);
INSERT INTO `video` (`id_Video`, `nom_Video`, `saison_Video`, `episode_Video`, `duree_Video`, `url_Video`, `image_Video`, `synopsis_Video`, `sup_Video`) VALUES
(4, 'Dark avenger le Pk', 1, 4, 4, 'http://www.youtube.com/embed/9_vnnMML3jg', , 'Officiellement membre de la guilde Noob, Gaea essaie desesperement de semer Sparadrap pour effectuer ses quetes en paix. C''est alors que Dark Avenger, un player killer, la prend en chasse...\r\n', 0);
INSERT INTO `video` (`id_Video`, `nom_Video`, `saison_Video`, `episode_Video`, `duree_Video`, `url_Video`, `image_Video`, `synopsis_Video`, `sup_Video`) VALUES
(5, 'La coalition', 1, 5, 4, 'http://www.youtube.com/embed/TdZDiz3VZ7M', NULL, 'En pleine serie de quetes, Artheon se voit ordonner par un PNJ de tuer cinq membres de la Coalition, faction ennemie de l''Empire et donc de la guilde Noob...\r\n', 0),
(6, 'Mise a jour', 2, 1, 15, 'http://www.youtube.com/embed/NoMC9h7yDfw', NULL, 'Apres une longue attente, la mise a jour de Horizon 1.1 est enfin sortie. La Guilde Noob s''empresse de tester les nouveautes, mais Sparadrap decouvre dans son inventaire un objet curieux...\r\n', 0),
(7, 'La communaute du baton', 2, 2, 9, 'http://www.youtube.com/embed/WOODEj1BDIo', NULL, 'La decouverte du baton cheate de Sparadrap inquiete sa Guilde... et suscite aussi quelques convoitises. La discussion s''engage sur le sort a reserver au baton, et les tensions s''accumulent...', 0),
(8, 'SOS Soigneur', 2, 3, 7, 'http://www.youtube.com/embed/7BFwUkOWovU', NULL, 'Sparadrap peine a controler son nouvel equipement et Artheon envisage de recruter un nouveau soigneur pour eviter les problemes. En chemin, l''equipe rencontre Ystos, de la Guilde Justice...\r\n', 0),
(9, 'Pick Up', 2, 4, 7, 'http://www.youtube.com/embed/MGS1xZaj4Qk', NULL, 'Convaincu que Gaea triche pour monter ses niveaux, Omega Zell decide de la prendre en filature et ainsi prouver sa culpabilite. Artheon tente de le convaincre du contraire...', 0),
(11, 'Restons zen', 2, 5, 7, 'http://www.youtube.com/embed/qXOM5eoq3jU', NULL, 'Tandis que Gaea continue de se faire rusher par Fantom, elle rencontre un certain Maitre Zen, fondateur de la Guilde Noob, tout droit sorti de prison...', 0),
(12, 'Horizon 2.0', 3, 1, 12, 'http://www.youtube.com/embed/HqKujjIWH-s', NULL, 'Une nouvelle mise a jour d''Horizon est arrivee, et avec elle la nouvelle faction de l''Ordre. IRL, Omega Zell est trop pris par son travail pour jouer et fait une rencontre improbable pendant que les autres membres de la Guilde s''essayent aux nouveautes du jeu. Artheon, lui, annonce son demenagement...', 0),
(13, 'Reroll', 3, 2, 8, 'http://www.youtube.com/embed/nfb70SKQ9Z4', NULL, 'A cause du demenagement d''Artheon, l''equipe recherche un nouveau tank et envisage d''effectuer un re-roll pour Sparadrap...', 0),
(14, 'Hacker', 3, 3, 7, 'http://www.youtube.com/embed/DI7mcBUX8vU', NULL, 'Omega Zell reve de sa vengeance contre Tenshirock le Hacker. Pendant ce temps, celui-ci prepare son nouveau plan pour manipuler les Noob et leurs faiblesses...\r\n', 0),
(15, 'Recrutement', 3, 4, 7, 'http://www.youtube.com/embed/7X5mMbr-Z14', NULL, 'Le tank de Sparadrap n''etant pas a la hauteur, la guilde Noob se met en quete d''un nouveau membre. Ils se reunissent alors dans une zone neutre pour recuperer un tank bas niveau. Chacun possede sa propre methode de recrutement...', 0),
(16, 'Reportage', 3, 5, 8, 'http://www.youtube.com/embed/L9inGitIp1Y', NULL, 'Morgan Lavande est charge par Feminine TV de realiser un reportage sur la place de la femme dans les environnements virtuels... ', 0),
(17, 'Prologue', 4, 0, 6, 'http://www.youtube.com/embed/k20lB3c5Ik4', NULL, 'Un nouveau joueur se connecte a Horizon.  Des son arrivee, il se retrouve confronte a ces pires ressortissants : la Guilde NOOB !', 0),
(18, 'PK-dilles', 4, 1, 8, 'http://www.youtube.com/embed/h8zaY5FeFWQ', NULL, 'Une nouvelle mise a jour est lancee. La Guilde et ses nouveaux membres se retrouvent de nouveau confrontes au probleme des PK. Dark Avenger, de son cote, vit tres mal cette nouvelle rencontre avec Sparadrap...', 0),
(19, 'Conflit d''interet', 4, 2, 8, 'http://www.youtube.com/embed/YhM9P8kOooM', NULL, 'Artheon a nomme Omega Zell au rang de chef de Guilde, ce qui pose probleme aux autres membres. Dark Avenger, lui, risque sa place au sein de sa Guilde a cause de ses problemes avec Sparadrap...\r\n', 0),
(20, 'Dragematique', 4, 4, 10, 'http://www.youtube.com/embed/K8ol4sw9SNA', NULL, 'Kevin Lepape rend visite a Stanislas Chatelain pour le convaincre de reprendre sa gestion de la Guilde. Il lui reproche d''avoir laisse tomber ses camarades pour les beaux yeux de Kary...', 0),
(21, 'Sourcelame', 4, 3, 8, 'http://www.youtube.com/embed/zVBkoZMoUus', NULL, 'Omega Zell abuse de son statut quand Artheon revient avec une alliee de l''Ordre. Il explique son projet de trouver la legendaire epee Sourcelame...', 0),
(22, 'Prologue', 5, 0, 5, 'http://www.youtube.com/embed/Mvxj1Y9GnQA', NULL, 'Le combat entre Artheon et Sparadrap fait rage suite a la dissolution de la Guilde...', 0),
(23, 'La partie continue', 5, 1, 15, 'http://www.youtube.com/embed/y0IpZG-4yyo', NULL, 'Les anciens membres de la Guilde Noob se retrouvent sur une quete qui prend une tournure inattendue. Du cote de la Guilde Justice, Fantom s''entraine avec Ystos  pour pouvoir vaincre Spectre...\r\n', 0),
(24, 'Nouvelles ambitions', 5, 2, 9, 'http://www.youtube.com/embed/yaf6NFmorQ8', NULL, 'Artheon decouvre les avantages d''avoir trouve Sourcelame et apprend que les createurs d''Horizon envisage de faire de lui un veritable pilier d''Olydri en integrant son avatar dans les intrigues du jeu. De son cote, Omega Zell, entraine par Saphir, entrevoit la possibilite d''acceder aux classes legendaires...', 0),
